import React, { useEffect, useState } from "react";
import Button from '@material-ui/core/Button';

const App = () =>{
const [num, setNum] = useState(0)
const [nums, setNums] = useState(0)

useEffect(() => {
    alert("yes Click Me")
},[num])
    return(
       <>
    <Button  onClick={() => {
        setNum(num+1);
    }}>Click Me {num}</Button>
    <br/>
    <button onClick={() => {
        setNums(nums+1);
    }}>Click Me {nums}</button>
       </>
    )
};

export default App;
